import ReactDOM from 'react-dom';
import xml2js from 'xml2js';

function Sitemap() {
    var sitemapJson = fetchSitemap("https://www.smu.edu.sg/sitemap.xml");
        console.log("sitemapJson", sitemapJson);
    return (
        <p>Sitemap content</p>
    );
}

async function fetchSitemap(url) {
    const response = await fetch(url)
    const xmldata = response.text();    
    var parser = new xml2js.Parser();
    const json = await parser.parseString(xmldata, function (err, result) {
            return result;
        });
    return json;
}

export default Sitemap;
